import React, { Component } from "react";
import NavBar from "../components/navbar";
import Footer from "../components/footer";
import SimplePageTitle from "../components/simplePageTitle";
import "./signin.css";
class Signin extends Component {
  render() {
    return (
      <React.Fragment>
        <NavBar />
        <SimplePageTitle title="Sign In" subtitle="" />
        <div className="container text-light">
          <div className="form-container">
            <div class="form-group">
              {/* <label className="h3" for="emailInput">
                Email:
              </label> */}
              <input
                type="email"
                class="form-control form-input text-light form-control-lg"
                id="emailInput"
                aria-describedby="emailHelp"
                placeholder="Enter your email"
              />
            </div>
            <div class="form-group">
              {/* <label className="h3" for="passwordInput">
                Password:
              </label> */}
              <input
                type="password"
                class="form-control form-input text-light form-control-lg"
                id="passwordInput"
                placeholder="Enter your password"
              />
            </div>

            <button type="submit" class="btn btn-outline-light btn-lg auth-btn">
              Login
            </button>
          </div>
        </div>

        <Footer />
      </React.Fragment>
    );
  }
}

export default Signin;
